import React from "react"
import './Projects.css'
import {Link} from 'react-router-dom'

function Projects(){
    return(
        <>
        <div className="plants-main">
            <Link to="/projects/garden" className="plants-inner annuals"> Annuals</Link>
            <Link to="/projects/bath-and-body" className="plants-inner perennials">Perennials</Link>
            <Link to="/projects/lavender" className="plants-inner fruits">Fruits</Link>
        </div>
        </>
    );
}

export default Projects;
